import react,{Component} from 'react';
import ReactDOM from 'react-dom';
import {Nav,NavDropdown,Navbar,Form,FormControl,Button} from 'react-bootstrap';
import {BrowserRouter as Link,Switch,Router,Route} from "react-router-dom";
import loginpage from "./loginpage";
import SignUp from "./signup";

class myNavbar extends Component{
// constructor(props){
//     super(props);
//     this.state={
//         username:""
//     }

//     this.setState({username : props.username});
// }
render()
{
return(
    <Router>
    <Navbar bg="light" expand="lg">
        <Navbar.Brand>AddJency</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Link to={"/sign-in"}>Sign-In</Link>
            <Link to={"/sign-up"}>Sign-Up</Link>
            <NavDropdown title="Dropdown" id="basic-nav-dropdown">
                <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                <NavDropdown.Divider />
                <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
            </NavDropdown>
        </Nav>
        <Form inline>
            <FormControl type="text" placeholder="Search" className="mr-sm-2" />
            <Button variant="outline-success">Search</Button>
        </Form>
        </Navbar.Collapse>
    </Navbar>

    <Switch>
    {/* <Route exact path='/' component={Home} /> */}
        <Route path="/sign-in" component={loginpage} />
        <Route path="/sign-up" component={SignUp} />
    </Switch>
  </Router>
);
}
}
export default myNavbar;
